"156057":{"id":"156057","name":"Gods' Game We Play","slug":"gods-game-we-play","original_title":"神は遊戯に飢えている。","overview":"Em um mundo de deuses entediados, os humanos são obrigados a enfrentá-los em jogos mentais. Com três derrotas, os deuses perdem o direito de desafiar, enquanto 10 vitórias significam o triunfo humano! Faye, determinado a alcançar o impossível, entra no teste final de astúcia contra os deuses. Ele desafiará as divindades ou será apenas mais um derrotado?","first_air_date":"2024-04-01","episode_run_time":24,"vote_average":7.7,"number_of_seasons":1,"number_of_episodes":13,"created_by":[],"production_companies":["LIDENFILMS","Pony Canyon","KADOKAWA","Ultra Super Pictures","AT-X","Crunchyroll","Sammy","bilibili"],"genres":["Animação","Drama","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/s8gJHtPcbOdv7eGiBqE6m0izFG9.jpg","poster_path":"https://image.tmdb.org/t/p/original/eYI68Qz9z9k2tF83I0omuvsSMDw.jpg","cast":["Akari Kito","Nobunaga Shimazaki","Hina Tachibana","Kanna Nakamura","Ami Koshimizu"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/uBVxIofgBq2Tp36F1ggcNUfy6VG.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/uBVxIofgBq2Tp36F1ggcNUfy6VG.jpg","air_date":"2024-04-01","episode_count":13,"overview":"N/A","vote_average":6,"episodes":{"1":{"name":"O Jogo dos Deuses que Jogamos","overview":"Num mundo onde os deuses vivem entediados, eles dão permissões especiais para humanos participarem dos jogos dos deuses.","air_date":"2024-04-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/7o7cAhtrQ7y3QX9EDkHradJUWhx.jpg","vote_average":7.5},"2":{"name":"Pega-Pega dos Deuses","overview":"Fay é arrastado por Leshea para o próximo jogo dos deuses, para começarem sua jornada pela completude dos jogos.","air_date":"2024-04-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/l1oVtorDukT5DrlmG9mJqB0aOOp.jpg","vote_average":6.5},"3":{"name":"Sou Pearl Diamond","overview":"Leoleshea tem pressa para seguir com os jogos ao lado de Fay, mas tem um pequeno problema a resolver primeiro.","air_date":"2024-04-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/sfqj1CxAQ16iosZYH00EoEtKp3F.jpg","vote_average":6.5},"4":{"name":"Uroboros","overview":"Fay e seu grupo acabam entrando no jogo mais difícil de que se tem registro, e ainda precisam lidar com a hostilidade do Time Inferno.","air_date":"2024-04-22","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/y7LbyUmi8jTYC7Iqrlb2XasIaoN.jpg","vote_average":5.5},"5":{"name":"Campeonato Mundial de Jogos","overview":"Leshea está inquieta, pois queria jogar, mas o sistema de mergulho está entupido de pedidos. Para evitar os ataques de abstinência da ex-deusa, Miranda tem uma ideia.","air_date":"2024-04-29","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/5G0Aiaab2cZQlSS1ci6s3y3Lc5r.jpg","vote_average":6},"6":{"name":"Arena Mental","overview":"Fay e seu grupo enfrentam o time de Dax em uma grande amostra de jogos da cidade.","air_date":"2024-05-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/lb6dBN43JGmkxhbPwHgQWWJo5qL.jpg","vote_average":6},"7":{"name":"Revezamento ao Sol","overview":"Fay e seu grupo circulam pela cidade antes de participarem da segunda parte das competições e são surpreendidos por fãs.","air_date":"2024-05-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/zMF1AUN8tt9x1gg7WMqJbmi4iK9.jpg","vote_average":6},"8":{"name":"Onde Foi Parar o Sol?","overview":"Fay e seu grupo continuam seu jogo contra Mahtma II sob o sol escaldante do deserto.","air_date":"2024-05-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dKj0CFD1uVyongpuJzeNpAvAaJs.jpg","vote_average":6},"9":{"name":"Apostadora","overview":"Fay e seu grupo retornam a Ruin para que possam jogar com a Apostadora.","air_date":"2024-05-27","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/wvimWdwrMrYRYshlbpuzV344sEi.jpg","vote_average":5},"10":{"name":"As Três Trapaças Feitas por Deus","overview":"Depois da derrota de Nel, Fay toma a frente e desafia Gremoire para que sua amiga volte à ativa.","air_date":"2024-06-03","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/8F8sbGzoDqZTVrToO0Q7wfeFS80.jpg","vote_average":7},"11":{"name":"O \"Labirinto\" sem Retorno, Luceimia","overview":"Fay e seu grupo entram no labirinto para salvar os jogadores presos e sofrem as consequências de sua imprevisibilidade.","air_date":"2024-06-10","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/xf0EQUDoSJaxCZRE74FtEPDxjor.jpg","vote_average":6},"12":{"name":"O Labirinto do \"Submundo\" da Morte e Ressurreição, Luceimia","overview":"Fay e seu grupo se esforçam para matar um chefe de raid, mas Uroboros chega e o derrota facilmente em sua segunda aparição. Após isso, o grupo segue sem Ashlan para desvendar mais mistérios do labirinto.","air_date":"2024-06-17","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/uA5d3lx2gFA9l4iBAHHQSzhR2bf.jpg","vote_average":5},"13":{"name":"Bom Jogo, Bem Jogado","overview":"Fay e seu grupo caem em um grande buraco e chegam à sala do chefe final, mas a deusa parece não estar lá, como suspeitavam.","air_date":"2024-06-24","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/wegOlJCw6MbHGHpYOe4LH1bqvW7.jpg","vote_average":5}}}}},
