"204266":{"id":"204266","name":"Trigun Stampede","slug":"trigun-stampede","original_title":"TRIGUN STAMPEDE","overview":"No escaldante planeta de No Man's Land, infestado de a sobrevivência da humanidade depende de Plants, usinas biológicas capazes de produzir qualquer substância a partir do nada. E nesse mundo que vive o Tufão Humano, um encrenqueiro com uma recompensa de $$6 milhões por sua cabeça. Seu nome é Vash, o Estouro da Boiada. Para descobrir a verdade por trás de Vash, a jovem repórter novata Meryl Stryfe e o veterano beberrão Roberto de Niro iniciam uma investigação, mas acabam se juntando a Vash numa missão para deter seu irmão gêmeo maligno Millions Knives.","first_air_date":"2023-01-07","episode_run_time":24,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":11,"created_by":[],"production_companies":["Orange","Shonen Gahosha","TOHO"],"genres":["Animação","Action & Adventure","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/5oxSBGmDBXuGrF3I693295D8Bul.jpg","poster_path":"https://image.tmdb.org/t/p/original/8mqvaj0a74JZkvCc4w1J2ePchl.jpg","cast":["Yoshitsugu Matsuoka","あんどうさくら","松田賢二","Yoshimasa Hosoya","池田純矢"],"trailer":"Xs_q7mu0z84","seasons":{"0":{"name":"Especiais","poster_path":"https://image.tmdb.org/t/p/original/74RxiAttmXxs8pDn0cz5pnwwf97.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/74RxiAttmXxs8pDn0cz5pnwwf97.jpg","air_date":"2023-03-25","episode_count":1,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Duelo em July","overview":"Knives consegue abrir o portal como planejou, mas Meryl está decidida a tentar trazer Vash de volta, mesmo que pareça impossível.","air_date":"2023-03-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/4BFKs6C2OmCYNv9ej2TgsjMQwTr.jpg","vote_average":0}}},"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/8mqvaj0a74JZkvCc4w1J2ePchl.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/8mqvaj0a74JZkvCc4w1J2ePchl.jpg","air_date":"2023-01-07","episode_count":11,"overview":"N/A","vote_average":7.7,"episodes":{"1":{"name":"Terra de Ninguém","overview":"Roberto e Meryl estão em sua excursão pelo deserto escaldante para encontrar mais informações sobre o famigerado \"Tufão Humanoide\"... Mas não será nada fácil!","air_date":"2023-01-07","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/aN5hAxpjwSXczzHjaueONn8eS7G.jpg","vote_average":7.6},"2":{"name":"Homem em fuga","overview":"Depois de salvar a cidade dos policiais de July, Vash conta sua situação para os repórteres, que ainda têm suas dúvidas sobre a inocência do rapaz.","air_date":"2023-01-14","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/q2T2pdmYtfhdkZFvLkq1nZHeQtv.jpg","vote_average":7.8},"3":{"name":"Ó, Luz, Ilumine as Trevas","overview":"Após toda a confusão com a família Nebraska, Vash e seus amigos precisam se preparar para outra ameaça: E. G. Bomber!","air_date":"2023-01-21","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tLw38Xk9YZBEAYJQXAq1aca4vwP.jpg","vote_average":8.4},"4":{"name":"Fome!","overview":"Depois de saírem de Jeneora Rock, Vash começa a andar com os jornalistas Meryl e Roberto, que agora são considerados como foragidos também!","air_date":"2023-01-28","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/8UI6gDi6QDzwXtQNzwUdg9TfAyw.jpg","vote_average":8},"5":{"name":"Criança da Bênção","overview":"Meryl e os demais seguem viagem pelo grande e escaldante deserto, até que chegam num lugar em que a areia é vermelha, o qual Roberto faz questão de explicar o motivo.","air_date":"2023-02-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/gn2x4ozxa5sZRVigKGq2s1VH9Rb.jpg","vote_average":7.5},"6":{"name":"Era uma Vez em Hopeland","overview":"Meryl e Roberto acompanham Vash e Wolfwood até o navio de areia que vai a July, e é ali que seus caminhos vão se separar...","air_date":"2023-02-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/9JRdLSjcGrC0hl33lxRNpcSjbxN.jpg","vote_average":8},"7":{"name":"Wolfwood","overview":"O navio em que Vash e Wolfwood é invadido pela gangue Bad Lads. Além de tudo, o navio perde o controle e pode devastar a cidade. Como sempre, Vash fará de tudo para salvar todos da melhor maneira possível.","air_date":"2023-02-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/i7VRMw4i0zI1kVPhgcvCBxPxLnd.jpg","vote_average":7.7},"8":{"name":"Nosso Lar","overview":"O passado de Vash é um mistério para todos e está cada vez mais claro que ele não é uma pessoa comum!","air_date":"2023-02-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dPTMT3RuQqx8G8G80JeqRbBwdrW.jpg","vote_average":8},"9":{"name":"Millions Knives","overview":"Um pouco do passado de Millions Knives e Vash é mostrado. Vash é salvo por conhecidos antigos.","air_date":"2023-03-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/ajNQHBkBWzSJtvPp5U0U37NXjzF.jpg","vote_average":7.7},"10":{"name":"Humanidade","overview":"Zazie questiona Maryl e Roberto sobre o melhor para seu planeta, mas acaba sendo interrompido pelo Doutor Conrad, que busca compreensão sobre seus feitos.","air_date":"2023-03-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/ddO1NYKO6GkdG9SAov3E3JDoLXj.jpg","vote_average":7},"11":{"name":"Para um Novo Mundo","overview":"Meryl está decidida a ir atrás de Vash após um incentivo de seu falecido veterano Roberto. Contudo, ao alcançá-lo, ela fica diante de uma situação inesperada...","air_date":"2023-03-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/kZ22uJgKh5hiWaY78j08m6iJUQJ.jpg","vote_average":7}}}}},
